import styled from 'styled-components';

export const BtnWrapper = styled.div`
  display: flex;

  img {
    position: relative;
    width: 30px;
    margin-left: 15px;
    cursor: pointer;
    :hover {
      border-bottom: 1px solid black;
    }
  }
`;
